package com.major.repository;

import java.nio.charset.StandardCharsets;

import MFS100.FingerData;
import MFS100.MFS100;
import MFS100.MFS100Event;

public class MatchingFinger implements MFS100Event {

	private MFS100 mfs;
	private byte[] fingerToMatch,fingerRecieved;
	private String fingerRecievedInString,finger;
	
	public MatchingFinger() {
		
		//this.fingerToMatch = new byte[1028];
		//this.fingerRecieved = new byte[1028];
		this.fingerRecievedInString ="";
		//finger="data:image/bmp;base64,";
		//this.fingerToMatch=finger.getBytes(StandardCharsets.UTF_8);
		
	}
	
	public long matchFinger() throws Exception
	{
		mfs=new MFS100(this, " ");
		long retMatch=0;
		String base64Image = this.fingerRecievedInString.split(",")[1];
		fingerRecieved = javax.xml.bind.DatatypeConverter.parseBase64Binary(base64Image);
		base64Image = this.finger.split(",")[1];
		fingerToMatch = javax.xml.bind.DatatypeConverter.parseBase64Binary(base64Image);
		retMatch=mfs.MatchISO(fingerToMatch, fingerRecieved);
		
		return retMatch;
//		if(retMatch>=14000)
//			return true;
//		else
//			return false;
	}

	public byte[] getFingerToMatch() {
		return fingerToMatch;
	}

	public void setFingerToMatch(byte[] fingerToMatch) {
		this.fingerToMatch = fingerToMatch;
	}

	public String getFingerRecievedInString() {
		return fingerRecievedInString;
	}

	public void setFingerRecievedInString(String fingerRecievedInString) {
		this.fingerRecievedInString = fingerRecievedInString;
	}
	 
	public void convertFinger()
	{
		this.fingerRecieved=fingerRecievedInString.getBytes(StandardCharsets.UTF_8);
		System.out.println(this.fingerRecievedInString+"\n"+this.fingerRecieved);
	}

	@Override
	public void OnCaptureCompleted(boolean arg0, int arg1, String arg2, FingerData arg3) {
		// TODO Auto-generated method stub
		
	}

	@Override
	public void OnPreview(FingerData arg0) {
		// TODO Auto-generated method stub
		
	}

	
}
